import React from 'react';
import './Navbar.css';

const Navbar = () => {
    handle_click = (e) =>{
        console.log(e.target.value);
    }
    return(
        <nav id="main_navigation">

            <ul>
                <li><a className="home" href="/">Home</a></li>
                <li><a className="live_locations" href="/livelocation">Live Locations</a></li>
                <li><a className="heatmap" href="/heatmap">Heatmap</a></li>
                <li><a className="usertraces" href="/usertrace">User Trace</a></li>
            </ul>

        </nav>
    )
}

export default Navbar
